import React from "react";
import { createPath } from "react-router-dom";

export default function Colors(props) {
	const colors = {
    'Burnt Sienna': '#EF5350',
		'French Rose': '#EC407A',
		'Amethyst': '#AB47BC',
		'Fuchsia Blue': '#7E57C2',
		'Indigo': '#5C6BC0',
		'Picton Blue': '#42A5F5',
		'Dodger Blue': '#29B6F6',
		'Scooter': '#26C6DA',
		'Jungle Green': '#26A69A',
		'Fern': '#66BB6A',
		'Celery': '#9CCC65',
		'Wattle': '#D4E157',
		'Gorse': '#FFEE58',
		'Sunglow': '#FFCA28',
		'Sunshade': '#FFA726',
		'Burning Orange': '#FF7043',
		'Cement': '#8D6E63',
		'Silver': '#BDBDBD'
  }

	function ColorsList() {
		let colorSelects = [];
		for (const color in colors) {
			console.log(color)
			colorSelects.push(
				<p>{color}</p>
			)
		}
		return colorSelects;
	}

	return (
		<div className="form-group">
			{ColorsList()}
		</div>
	)
}
